import React from "react";

import "./App.css";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import Login from "./components/loginForm/login";

function App() {
  return (
    <div>
      <Routes>
        <Route exact path="/" component={Login} />
      </Routes>
    </div>
  );
}

export default App;
